import React, { useState, useEffect, useContext } from 'react';
import { Card } from '../component';
import useContent from '../hook/use-content';
import * as ROUTES from '../config/router';

export default function BrowseContainer({children, ...restProps}) {
    
    const content = useContent('storylist');
    console.log(content);

    let data = [{
        id: '1222',
        name: 'thanks',
        summary: 'hy'
    }]

    return (
        <Card.Group>
            {data.map((slideItem) => {
                return (<Card key={`${slideItem.id}`}>
                            <Card.Meta>
                                <Card.Title>{slideItem.name}</Card.Title>
                                <Card.Text>{slideItem.summary}</Card.Text>
                            </Card.Meta>
                        </Card>)
            })}
            <div>container stuff</div>
        </Card.Group>
    )
}
